import React from "react";
import { Formik, Form, Field, ErrorMessage } from "formik";
const CreatePost = () => {
  return (
    <div>
      <Formik>
        <Form>
          <label>Title:</label>
          <Field id="inputCreatePost" placeholder="Add title" name="Title" />
        </Form>
      </Formik>
    </div>
  );
};

export default CreatePost;
